import './App.css';
import TreeView from './TreeView';


const tree = {
  root: "Reports",
  data: [
    { name: "1", data: [{ name: "1.1" }, { name: "1.1", data: [{ name: "1.1.1", data: [{ name: "1.1.1.1" }] }] }, { name: "1.2", data: [{ name: "1.2.1", data: [{ name: "1.2.1.1" }] }] }] },
    { name: "2", data: [{ name: "2.1", data: [{ name: "2.1.1", data: [{ name: "2.1.1.1" }] }] }] }
  ]
}


function App() {
  return (
    <div className="App">
      <TreeView index={0} data={tree.data} name={tree.root} />
    </div>
  );
}

export default App;
